import React, { Component } from "react";
import PropTypes from "prop-types";

class Todo extends Component {
  getStyle() {
    return {
      backgroundColor: "grey",
    };
  }
  render() {
    return <div>{this.props.todoProp.title}</div>;
  }
}

Todo.PropTypes = {
  todoProp: PropTypes.object.isRequired,
};

export default Todo;
